import React, { Component } from 'react'
import { Grid, Image, Label, Segment, Container, Card,Input, Form,Icon, TextArea } from 'semantic-ui-react'

class Bio extends Component {
  render() {
    return (
        <Container>
                    <Form.Group widths='equal'>

<Form.Input disabled icon={<Icon name='pencil' inverted circular link />} placeholder='daniellopezcs' />
<br/> 
<br/> 

<Form.TextArea fluid disabled  icon={<Icon name='pencil' inverted circular link />} placeholder ='I am a software engineer'/>
<br/>
<br/>
<Form.Input icon={<Icon name='pencil' inverted circular link />} placeholder='Search...' />
<br/>  
<br/> 
<Form.Input icon={<Icon name='pencil' inverted circular link />} placeholder='Search...' /> 
</Form.Group>

</Container>
    )
  }
}
export default Bio;
